INSERT INTO `core_cms_node_game_buy_info` (`node_id`, `listbuyinfo`, `checkinfo1`) VALUES
(169, '      <p>Buy Game Account, Get FUT Coins. Two advantages of this transaction method:</p><ul>\r\n                    <li>To new gamers of FIFA. Anyway, I recommend this purchase for new gamers strongly.Play\r\n                        game directly and own high level. What’s more, enough coins for you to buy more\r\n                        excellent cards.</li>\r\n                    <li>To regular gamers of FIFA. Get large coins via transaction in batches, it means\r\n                        you set several players in market.</li>\r\n                </ul>\r\n            <p></p>\r\n            <ul>\r\n                <li>Step1. Buy an account with enough coins from futseller.com</li>\r\n                <li>Step2. Check the total max price of your players</li>\r\n                <li>Step3. Set all the players on market on your original account</li>\r\n                <li>Step4. Buy all the players with new account</li>\r\n                <li>Step5. Get coins from new account</li>\r\n            </ul>', '<strong>Notice</strong>:The seller creates a new FIFA account with the resepective FIFA Coins amount on it. After the process is completed you will get account name, password and the secret answer.Afterwards you can use the account as you wish.  (Delivery Time: 1-24 Hours) <br><em>Please make sure your email address is valid.</em> If you have any question, feel free to contact our 24/7 online live chat.'),
(170, '<p style=\"margin-top: 0px; margin-bottom: 10px; white-space: normal; box-sizing: border-box; color: rgb(51, 51, 51); font-family: &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);\">We use FIFA Ultimate Team Transfer Market to deliver coins. Customer needs to sell a player at the Transfer Market (Customers must set A Buy now Price and please set the auction duration to 3 days) and tell us the player info. Then we will buy the player that you set to complete the trade. (Due to 5% auciton fee, customer will receive 95% of buy now price.)</p><p style=\"margin-top: 0px; margin-bottom: 10px; white-space: normal; box-sizing: border-box; color: rgb(51, 51, 51); font-family: &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);\">The delivery is about 1-3 hours after payment receipt. However, we can fulfil 90% of our orders within 10-30 minute after payment is received.</p><p><br/></p>', '<strong>Notice</strong>: Please list the player and set the auction duration for <span style=\"font-weight:bold; color:Red\">3 days</span>.'),
(181, '<ul>   <li>1.Please provide your correct account information.</li>\r\n<li>2.Please make sure there are 200 coins on your PS account.</li>\r\n <li>3.Do not login game during Comfort Trade Service.</li>\r\n <li>4.If you have credit card information on your PSN account. Please delete it.</li>\r\n<li>5.After your order is completed,don\'t forget to change your PSN password.</li>\r\n </ul>\r\n            <br>\r\n            How to delete your credit card information?\r\n            <ul>\r\n                <li>1.Go to \"www.playstation.com\"</li>\r\n                <li>2.Sign in your PSN accont information.</li>\r\n                <li>3.Choose \"My Account\"→\"Manage My Account\"→\"Sign in Again\"→\"Account\"→\"Billing Information\"→Delete.</li>\r\n            </ul>\r\n            <br>Forgot your Secret Question?\r\n                        <ul>\r\n                <li>1.Clear your browser\'s cache(This is very Important)</li>\r\n                <li>2.Go to the FUT website(www.easports.com/fifa) and Sign in.</li>\r\n                <li>3.Click\"ULTIMATE TEAM\" and \"WEB APP\"</li>\r\n                <li>4.When you are asked for your Secret Question, click on \"Forgot answer?\" and \"Lock Account\"</li>\r\n                <li>5.Next, you\'ll need to login to your trusted console and load FIFA 15</li>\r\n                <li>6.Once you enter the Ultimate Team game mode, you will be prompted to create a new Secret Question.</li>\r\n                <li>7.Once it\'s created, your account will be unlocked. Don\'t forget it again.</li>\r\n            </ul>\r\n', '<ul>\r\n<li>1.Please provide your correct account information.</li><li>2.Do not login game during Comfort Trade Service.</li><li>3.If you have credit card information on your PSN account. Please delete it.</li></ul>'),
(183, '<ul><li>1.Pay the order successfully.</li>\n<li>2.Get start price and buy now price from our online support agents (LiveChat).</li>\n<li>3.List your card in transfer market with the start price and buy now price.</li>\n<li>4.After you done, we will buy your card within 10 minutes.</li></ul>', '<strong>HOW IT WORKS?</strong><ul><li>1.Pay the order successfully.</li><li>2.Get start price and buy now price from our online support agents (LiveChat).</li><li>3.List your card in transfer market with the start price and buy now price.</li><li>4.After you done, we will buy your card within 10 minutes.</li></ul>'),
(184, ' <p>We use FIFA Ultimate Team Transfer Market to deliver coins. Customer needs to sell a player at the Transfer Market (Customers must set A Buy now Price and please set the auction duration to 3 days) and tell us the player info. Then we will buy the player that you set to complete the trade. (Due to 5% auciton fee, customer will receive 95% of buy now price.)</p>\r\n            <p>The delivery is about 1-3 hours after payment receipt. However, we can fulfil 90%  of our orders within 10-30 minute after payment is received.</p>', '<strong>Notice</strong>:Need Fast Delivery? Please set start price to <span style=\"color:red\">123,000</span> and set auction duration for <span style=\"color:red\">3 days</span>. '),
(212, '<p>Pack Opening Account is much more cheaper than FIFA coins.</p> \n<p>It is safe and with quick delivery time. Each account with 2200  fifa points.You can use it to open player packs and there are some certain chances to open  Messi or Ronaldo.</p>', 'It is safe and with quick delivery time. Each account with 2200  fifa points.You can use it to open player packs and there are some certain chances to open  Messi or Ronaldo.'),
(213, '<ul><li>1.Pay the order successfully.</li>\n<li>2.Get start price and buy now price from our online support agents (LiveChat).</li>\n<li>3.List your card in transfer market with the start price and buy now price.</li>\n<li>4.After you done, we will buy your card within 10 minutes.</li></ul>', '<strong>HOW IT WORKS?</strong><ul><li>1.Pay the order successfully.</li><li>2.Get start price and buy now price from our online support agents (LiveChat).</li><li>3.List your card in transfer market with the start price and buy now price.</li><li>4.After you done, we will buy your card within 10 minutes.</li></ul>'),
(214, '      <p>Buy Game Account, Get FUT Coins. Two advantages of this transaction method:</p><ul>\n                    <li>To new gamers of FIFA. Anyway, I recommend this purchase for new gamers strongly.Play\n                        game directly and own high level. What’s more, enough coins for you to buy more\n                        excellent cards.</li>\n                    <li>To regular gamers of FIFA. Get large coins via transaction in batches, it means\n                        you set several players in market.</li>\n                </ul>\n            <p></p>\n            <ul>\n                <li>Step1. Buy an account with enough coins from futseller.com</li>\n                <li>Step2. Check the total max price of your players</li>\n                <li>Step3. Set all the players on market on your original account</li>\n                <li>Step4. Buy all the players with new account</li>\n                <li>Step5. Get coins from new account</li>\n            </ul>', '<strong>Notice</strong>:The seller creates a new FIFA account with the resepective FIFA Coins amount on it. After the process is completed you will get account name, password and the secret answer.Afterwards you can use the account as you wish.  (Delivery Time: 1-24 Hours) <br><em>Please make sure your email address is valid.</em> If you have any question, feel free to contact our 24/7 online live chat.'),
(215, '', 'Buying Tips: In order to complete your order and deliver FIFA coins quickly, please make sure set all the player cards at the same Start Price and Time Remaining.\n<script type=\"text/javascript\">\n$(document).ready(function(){ var num = $(\':input[name=product_id]\').data(\'gold_num\') / 10;\nfor(var i = 10; i>num; i--){ 	$(\'#order-attr-player_name_\' + i).hide(); $(\'#order-attr-rating_\' + i).hide(); }\n}); </script>');
INSERT INTO `core_cms_node_news` (`node_id`, `content`, `description`, `keyword`) VALUES
(172, '<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; padding: 5px 0px; color: rgb(51, 51, 51); font-family: &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; line-height: 32px; white-space: normal;\">Welcome to FIFAcoins-uk.com.</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; padding: 5px 0px; color: rgb(51, 51, 51); font-family: &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; line-height: 32px; white-space: normal;\">If you have questions about our service or existing orders, please contact us on the button Live Help. Questions about other aspects of FutSeller should be aligned with the corresponding e-mail address.</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; padding: 5px 0px; color: rgb(51, 51, 51); font-family: &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; line-height: 32px; white-space: normal;\">Customer Support and Complaint:&nbsp;fifa@fifaconis-uk.com</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; padding: 5px 0px; color: rgb(51, 51, 51); font-family: &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; line-height: 32px; white-space: normal;\">Address: &nbsp;<br style=\"box-sizing: border-box;\"/>Zip: &nbsp;</p>', '', ''),
(173, '<p><br/></p><h4>Sell To Us / Exchange</h4><p>Are you looking for a safe and legit website to sell FIFA 14 &amp; 15 Ultimate Team coins at a decent price? <br/>Do you feel confused that fut coins can’t be carried over from FIFA 14 to FIFA 15 ultimate team? <br/>Good news! From now on, we start to purchase FIFA coins! And we do exchange FIFA 14 coins to FIFA 15 coins!</p><p><br/></p><p><br/></p><h4>How to sell FIFA coins to us ?</h4><ul class=\" list-paddingleft-2\"><li><p>1. Contact our live chat and tell us your contact information, coins amount, platform, your paypal email, the currency you want, like GBP, EUR, USD,CAD and so on.</p></li><li><p>2. Our professional staff will tell you the price and list a player in the transfer market.</p></li><li><p>3. Once you buy the player, we will send the payment via paypal within 24 hours.</p></li></ul><p><br/></p><p><br/></p><h4>How to exchange FIFA 14 coins to FIFA 15 coins?</h4><ul class=\" list-paddingleft-2\"><li><p>1. Contact our live chat and tell us your coins amount, platform, the platform you want to exchange.</p></li><li><p>2. Our professional staff will tell you the exchange rate and list a player in the transfer market.</p></li><li><p>3. After you buy the player, please tell us the player you list on the platform you want to exchange.</p></li><li><p>4. We buy your player, the exchange is done.</p></li></ul><p><br/></p><p><br/></p><h4>How to contact to us?</h4><p>24/7 professional and consummate live chat.<br/> <em class=\"glyphicon glyphicon-comment\"></em>&nbsp;&nbsp; Chat Now &nbsp;&nbsp;&nbsp;<br/>\n EMAIL: sales@futseller.com</p><p><br/></p><p><strong>Note:</strong> Please make sure that your contact information is able to help us contact you.</p>', '', ''),
(187, '<p>Since FutSeller.com is offering non-tangible goods we do not issue refunds on services which are NOT reversible. As a customer you are responsible for understanding this upon purchasing any item at our site. Please note that our FREE bonuses are not eligible for refund.</p><p>However, we realize that exceptional circumstance can take place with regard to the character of the product we supply. We fully understand the challenges and risks of buying online. That is why we guarantee your purchases will be 100% risk free.</p><p>There is absolutely nothing to worry about. Our customer service agents are available 24/7 for your questions before or after you order.</p><p>Therefore, we honor requests for the refund on the following reasons: Non-delivery of the product: Customers are recommended to contact us for assistance if you are not satisfied about our delivery. We guarantee A FULL refund if no agreement is reached. NO FURTHER QUESTIONS ASKED</p><p>Customers are guaranteed a FULL refund before we start the services. NO QUESTIONS ASKED Customers have the rights to cancel their orders at any time for a FULL refund. We recommend contacting us for a solution.</p><p>Partial-delivery of the product: Customers have the rights to cancel partly delivered orders. Refund will be calculated based on the percentage of completion. Customers have the rights to stop the service at any time. Refund will be calculated based on the percentage of completion. Customers can ALWAYS return the virtual currency they have purchased from us within 3 days.</p><p>Refund will be processed immediately*. All you need to do is to use our 24/7 Live Chat Customer service line to speak with an agent. The average waiting time is 10 seconds. Click Here to start.</p><p>*it takes up to 3 days for the refund to show up on your credit card account. PayPal balance will be updated immediately</p>', '', ''),
(188, '<p>FutSeller.com and its affiliated websites (collectively, the &quot;Websites&quot;) respect your privacy rights and recognize the importance of protecting the Personal Information (as defined below) provided by you to us. This Privacy Policy describes how the FutSeller collects, stores, and uses the Personal Information you provide to us through the FutSeller&#39;s web sites and through telephone or e-mail communications you may have with us. This Privacy Policy also describes the choices available to you regarding the FutSeller&#39;s use of the Personal Information you provide to us, and the actions you can take to access this information and request that the FutSeller correct or delete it. We may not accept the gold from hacked accounts. Once you find we sell gold from compromised accounts, you can make complaints. Or we may clean those accounts immediately.</p><p><strong class=\"hptitfont\">Consent</strong></p><p>By using the FutSeller&#39;s web sites, you acknowledge that you have read this Privacy Policy and you consent to the practices described herein with respect to the FutSeller&#39;s collection, use and disclosure the Personal Information provided by you to us. This is the FutSeller&#39;s entire and exclusive Privacy Policy and it supersedes any earlier version. We reserve the right to change this Privacy Policy in accordance with the terms herein at any time, which is why we encourage you to visit this page often, review this Privacy Policy frequently, and remain informed about any changes to it. If, after review, you still have questions about any portion of this Privacy Policy, please contact the FutSeller using the contact information provided at the bottom of this Privacy Policy. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<br/></p><p><strong class=\"hptitfont\">PERSONAL INFORMATION</strong></p><p>&quot;Personal Information&quot; means information that can identify you as a specific individual, such as your name, address, phone number, e-mail address, or other contact information, whether at work or at home. On all FutSeller web sites that collect Personal Information, we specifically describe what information is required in order to provide you with the product, service, or feature you have requested. We collect Personal Information when you contact us, when you register with us, when you use our products and services, when you submit an order with us, when you visit our web sites or the web sites of certain of FutSeller&#39;s partners, and when you enter promotions and sweepstakes.</p><p><strong class=\"hptitfont\">REGISTRATION</strong></p><p>When you register with us on this site, you first complete the on-line registration form, which requires you to create a username and password. During registration, you are also required to provide Personal Information, which may include name, billing address, shipping address, telephone number, e-mail address, credit card number, and credit card expiration date. We use this information so that we may contact you about the services and products on the site(s) in which you have expressed interest or requested and to facilitate the completion of an order.</p><p><strong class=\"hptitfont\">PROMOTIONS, CONTESTS AND SWEEPSTAKES</strong></p><p>From time-to-time, FutSeller may provide you the opportunity to participate in promotions, contests or sweepstakes on its web site(s). Such promotions, contests and sweepstakes will also be governed by the rules and regulations posted with such promotions, contests and sweepstakes. If you participate, you will be required to register with FutSeller, which will require you to provide certain Personal Information. Participation in these promotions, contests and sweepstakes is completely voluntary and you therefore have a choice whether or not to register and provide your Personal Information. The requested information typically includes contact information, such as name, shipping address, e-mail address, and telephone number. We will use this information to notify winners and award prizes. Additionally, during your registration process you may opt-in to receiving additional related communications from us. If you decide to opt-in, we will use the information provided to send you communications described throughout this Privacy Policy.</p><p><strong class=\"hptitfont\">NEWSLETTERS</strong></p><p>If you wish to subscribe to FutSeller&#39;s newsletter(s), we will use your name and e-mail address to send the newsletters to you.</p><p><strong class=\"hptitfont\">OTHER INFORMATION COLLECTED</strong></p><p>Some information may be collected automatically every time you visit FutSeller&#39;s web sites, such as cookies and computer information. In addition, information may be collected from other independent, third-party sources. We also collect information about which pages you visit within this site. This site visitation data is identified only by a unique URL.</p><p><strong class=\"hptitfont\">COOKIES</strong></p><p>FutSeller uses both session ID cookies and persistent cookies as part of its interaction with your browser. A cookie is an alphanumeric identifier (a file) that FutSeller&#39;s web sites transfer to your computer&#39;s hard drive through a web browser to enable its systems to recognize your browser for record-keeping purposes. A session ID cookie expires when you close your browser, while a persistent cookie remains on your hard drive for an extended period of time. We use session ID cookies to make it easier for you to navigate our web sites. We use persistent cookies to identify and track which sections of its web site you most often visit. We also use persistent cookies in areas of its web site where you must register, and where you are able to customize the information you see, so that you don&#39;t have to enter your preferences more than once. By configuring the options in your browser, you may control how cookies are processed by your system. However, if you decline the use of cookies you may not be able to use certain features on this site and you may be required to reenter the information required to complete an order during new or interrupted browser sessions. Some of FutSeller&#39;s business partners (e.g. advertisers) use cookies on the site. We have no access to or control over these cookies (see &quot;Third Party Advertising&quot; and &quot;Third Party Cookies&quot; below). Accordingly, this Privacy Policy covers the use of cookies by FutSeller only and does not cover the use of cookies by any advertisers.</p><p><strong class=\"hptitfont\">LOG FILES</strong></p><p>As is true of most web sites, FutSeller gathers certain information automatically and stores it in log files. This information includes internet protocol (IP) addresses, browser type, internet services provider (ISP), referring/exit pages, operating system, date/time stamp, and click stream data. FutSeller uses this information to analyze trends, to screen for fraud, to administer FutSeller&#39;s sites, to track users&#39; movements around the web sites and to gather demographic information about FutSeller&#39;s user base as a whole.</p><p><strong class=\"hptitfont\">CLEAR GIFS</strong></p><p>(WEB BEACONS/WEB BUGS)The FutSeller employs a software technology called clear gifs (a.k.a. Web Beacons/Web Bugs), that helps it better manage content on its web sites by informing FutSeller what content is effective. Clear gifs are tiny graphics with a unique identifier, similar in function to cookies, and are used to track the online movements of web users. In contrast to cookies, which are stored on a user&#39;s computer hard drive, clear gifs are embedded invisibly on web pages and are about the size of the period at the end of this sentence. FutSeller uses clear gifs in its HTML-based e-mails to inform itself of which e-mails have been opened by you. This allows FutSeller to gauge the effectiveness of certain communications and the effectiveness of FutSeller&#39;s marketing campaigns. If you would like to opt-out of these e-mails, please see &quot;Choice and Opt-Out&quot; section of this Privacy Policy.</p><p><strong class=\"hptitfont\">INFORMATION FROM THIRD PARTY SOURCES</strong></p><p>To improve services and enhance personalization, FutSeller may periodically obtain information about you from other independent third party sources and add it to our account information. For example, when you visit a site on which FutSeller advertises, and click through such advertisement, FutSeller may place cookies on your computer.</p><p><strong class=\"hptitfont\">THIRD PARTY ADVERTISING</strong></p><p>The ads that appear from time to time on FutSeller&#39;s web sites are delivered to you by a third party. Information about your visits to the sites, such as number of times you have viewed an ad (but not your name, address or other Personal Information), is used to serve ads to you.</p><p><strong class=\"hptitfont\">VERIFICATION, BILLING, AND ORDER STATUS</strong></p><p>FutSeller collects Personal Information to verify the accuracy of your name, billing address, shipping address, credit card number, and credit card expiration date provided, to screen for fraud, to bill you for products and services purchased and to pay you for products and services sold. FutSeller uses your e-mail address(es) to contact you regarding the status of your order when necessary and to send you a Receipt Purchase/Sale Confirmation and Order Shipping Notification.</p><p><strong class=\"hptitfont\">SPECIAL OFFERS AND UPDATES</strong></p><p>FutSeller collects information about which sections of its web site you visit most often, so that it can send you our newsletter and information about relevant offers, promotions, contests, and sweepstakes which may interest you. Accordingly , FutSeller will occasionally send you information on products, services, special deals, promotions and sweepstakes.</p><p><strong class=\"hptitfont\">SERVICE-RELATED ANNOUNCEMENTS</strong></p><p>FutSeller may, but is not obligated, to send you strictly service-related announcements or rare occasions when it is necessary to do so. For example, if our service is temporarily suspended for maintenance, we might send you an e-mail. Generally, you may not opt-out of these communications since they are not promotional in nature. If you do not wish to receive them, you may have the option to deactivate your account.</p><p><strong class=\"hptitfont\">RESEARCH</strong></p><p>We also collect information for research purposes and to provide anonymous reporting for internal and external clients. FutSeller uses the information collected for its own internal marketing and demographic studies to improve customer service and product offerings.</p><p><strong class=\"hptitfont\">CUSTOMER SERVICE</strong></p><p>We will communicate with you in response to your inquiries, to provide the products and services you request, and to manage your account. We will communicate with you by e-mail, live chat or telephone, in accordance with your wishes.</p><p><strong class=\"hptitfont\">PREFERENCES</strong></p><p>FutSeller stores information that it collects through cookies, log files, and third party sources to create a profile of your preferences, in order to improve the content of FutSeller&#39;s web site for you.</p><p><strong class=\"hptitfont\">INFORMATION SHARING AND DISCLOSURE</strong></p><p>FutSeller does not sell or rent any of the information collected to third parties for any purposes, but it shares information with third parties as described below.</p><p><strong class=\"hptitfont\">SERVICE PROVIDERS</strong></p><p>FutSeller discloses the information collected to external service providers necessary to facilitate the following outsourced operations: address verification, credit card processing, fraud screening and order shipping.</p><p><strong class=\"hptitfont\">OTHER THIRD PARTIES</strong></p><p>FutSeller shares information, including Personal Information, with trusted third-party partners so that customers can receive information about third-party offers and promotions that may interest them. These third-party partners do not have independent rights to share the information provided to them by us.</p><p><strong class=\"hptitfont\">COMPLIANCE WITH LEGAL AUTHORITIES</strong></p><p>As required by law, and to enforce customers&#39; or FutSeller&#39;s legal rights, and to comply with local, state, federal and international law, FutSeller may disclose information to law enforcement agencies.</p><p><strong class=\"hptitfont\">CHOICE AND OPT-OUT</strong></p><p>If you no longer wish to receive FutSeller&#39;s promotional communications, you may &quot;opt-out&quot; of receiving them by following the instructions included in each communication.</p><p><strong class=\"hptitfont\">LINKS TO OTHER WEB SITES</strong></p><p>There are several places throughout FutSeller&#39;s web sites that may link you to other web sites that do not operate under this Privacy Policy. When you click through to these web sites, this Privacy Policy no longer applies. FutSeller recommends that you examine the privacy statements for all third party web sites to understand their procedures for collecting, using, and disclosing your Personal Information.</p><p><strong class=\"hptitfont\">STORAGE AND SECURITY OF PERSONAL INFORMATION STORAGE</strong></p><p>FutSeller protects the privacy and integrity of the information it collects by employing appropriate administrative protocols, technical safeguards, and physical security controls designed to limit access, detect and prevent the unauthorized access, improper disclosure, alteration, or destruction of the information under its control. FutSeller transmits the information used by its external service providers for the specific outsourced operations listed above across public and private networks via recognized encryption technologies, such as by using Secure Sockets Layer (SSL) software, which encrypts the information you input. Although FutSeller follows the procedures set forth above to protect the Personal Information submitted to FutSeller, no method of transmission over the Internet, or method of electronic storage, is 100% secure. Thus, while FutSeller strives to use commercially acceptable means to protect your Personal Information, FutSeller cannot guarantee its absolute security. If you have any questions about FutSeller&#39;s security on the its web sites, please feel free to contact live help.</p><p><strong class=\"hptitfont\">INTERNET FRAUD</strong></p><p>FutSeller has a ZERO TOLERANCE policy for Internet fraud or any attempt to access or acquire customer or other information on its web sites via illegal or surreptitious means. FutSeller works with local, national, and international fraud investigation agencies and employs a variety of electronic and other means to discourage, detect, and intercept fraudulent activities. FutSeller aggressively prosecutes, to the fullest extent of the law, those perpetrators apprehended conducting fraudulent activities on its web site. Agencies with which FutSeller cooperates are: state and local police authorities, the United States Federal Bureau of Investigation, US and International Customs Agencies, and Interpol.</p><p><strong class=\"hptitfont\">INTERNATIONAL TRANSFER</strong></p><p>Personal Information collected by FutSeller may be stored and processed in the United States or any other country in which FutSeller or its affiliates, subsidiaries or agents maintain facilities, and by using FutSeller&#39;s web sites, you consent to any such transfer of Personal Information outside of your country.</p><p><strong class=\"hptitfont\">CHILDREN</strong></p><p>FutSeller&#39;s sites are not intended for or directed to persons under the age of 13. FutSeller does not buy or sell products or services from or to children. Any person who provides their information to FutSeller through FutSeller&#39;s web sites represents to FutSeller that they are 13 years of age or older.</p><p><strong class=\"hptitfont\">CHANGES TO THIS STATEMENT</strong></p><p>FutSeller will from time-to-time update this Privacy Policy, each time revising the last updated date at the top of the Privacy Policy and indicate the nature of the revisions within the statement. FutSeller will notify customers of material changes to this statement by e-mail or by placing prominent notice on the its web site.</p><p><strong class=\"hptitfont\">Choice and Opt-Out</strong></p><p>If you no longer wish to receive FutSeller&#39;s promotional communications, you may &quot;opt-out&quot; of receiving them by following the instructions included in each communication or by e-mailing FutSeller at support@FutSeller.com</p><p><strong class=\"hptitfont\">CONTACT INFORMATION</strong></p><p>You may contact FutSeller by any contact ways listed on the website.</p>', '', ''),
(189, '<p>FutSeller is hold and operated the FutSeller.com network, hereafter FutSeller, and provides its services to you subject to the following conditions. When you visit or shop at www.FutSeller.com, you affirmatively accept the following conditions. Continued use of the site constitutes the affirmative agreement to these terms and conditions. FutSeller.com reserves the right to change the terms, conditions, and notices under which the FutSeller.com sites and services are offered, including but not limited to the charges associated with the use of the FutSeller.com sites and services. You are responsible for regularly reviewing these terms and conditions and any additional terms and conditions. Your continued use of the FutSeller.com sites and services constitutes your agreement to all such terms, conditions, and notices (see TERMS &amp; CONDITIONS and the PRIVACY POLICY).<br/></p><p><strong class=\"hptitfont\">PRIVACY</strong></p><p>Please read our PRIVACY POLICY, which also control your visit to FutSeller.com websites.</p><p><strong class=\"hptitfont\">ELECTRONIC COMMUNICATIONS</strong></p><p>If you browse FutSeller&#39;s websites or send e-mails to us, you are communicating with us electronically. You agree to receive communications from us electronically .We will contact with you by e-mail or by posting notices on this site. You agree that all agreements, notices, disclosures and other communications that we provide to you electronically satisfy any legal requirement that such communications be in writing.</p><p><strong class=\"hptitfont\">COPYRIGHT</strong></p><p>All content on this site, such as text, graphics, logos, button icons, images, audio clips, digital downloads, data compilations, and software, is the property of FutSeller or its content suppliers and protected by international copyright laws. The compilation of all content on this site is the exclusive property of FutSeller and protected by international copyright laws. All software used on this site is the property of FutSeller or its software suppliers and protected by international copyright laws.</p><p><strong class=\"hptitfont\">LICENSE AND SITE ACCESS</strong></p><p>FutSeller provides you a limited license to access and make personal use of this site and not to download (other than page caching) or modify it, or any portion of it, except with express written consent of FutSeller. This license does not include any resale or commercial use of this site or its contents; any collection and use of any product listings, descriptions, or prices; any derivative use of this site or its contents; any downloading or copying of account information for the benefit of another merchant; or any use of data mining, robots, or similar data gathering and extraction SERVICES. This site or any portion of this site may not be reproduced, duplicated, copied, sold, resold, visited, or otherwise exploited for any commercial purpose without express written consent of FutSeller. You may not frame or utilize framing techniques to enclose any trademark, logo, or other proprietary information (including images, text, page layout, or form) of FutSeller and our affiliates without express written consent. You may not use any meta tags or any other &quot;hidden text&quot; utilizing FutSeller&#39;s name or trademarks without the express written consent of FutSeller. Any unauthorized use terminates the permission or license granted by FutSeller. You are granted a limited, revocable, and nonexclusive right to create a hyperlink to the home page of www.FutSeller.com so long as the link does not portray FutSeller, its affiliates, or their products or services in a false, misleading, derogatory, or otherwise offensive matter and is revocable at will under any circumstance or condition by FutSeller. You may not use any FutSeller logos or other proprietary graphic or trademark as part of the link without express written permission.</p><p><strong class=\"hptitfont\">YOUR ACCOUNT</strong></p><p>If you use this site, you are take charge of maintaining the confidentiality of your account and password and for restricting access to your computer, and you agree to accept responsibility for all activities that occur under your account or password. If you are under 18, you may use FutSeller&#39;s services only with involvement of a parent or guardian. FutSeller and its affiliates reserve the right to refuse service, terminate accounts, remove or edit content, or cancel orders in their sole discretion.</p><p><strong class=\"hptitfont\">SITE &amp; SERVICES</strong></p><p>FutSeller provided links and pointers to Internet sites for third-parties to maintain. Neither FutSeller, its parent or supplementary companies, nor their affiliates operate or control in any respect any information, products or services on these third-party sites. The content in this site and the third-party sites are provided &quot;as is&quot; and without assurance of any kind either expressed or implied. To the fullest field permissible pursuant to the applicable law, FutSeller denies all assurance, expressed or implied, including, but not limited to, implied assurance of merchantability and fitness for particular purpose. Regarding all virtual goods and services FutSeller is only providing a service to buyer; no goods or property are being sold to buyer by FutSeller.</p><p><strong class=\"hptitfont\">REVIEWS, COMMENTS, COMMUNICATIONS AND OTHER CONTENT</strong></p><p>Visitors may post reviews, comments, and other content; and other communications; and submit suggestions, ideas, comments, questions, or other information, so long as the content is not illegal, obscene, threatening, defamatory, invasive of privacy, infringing on intellectual property rights, or otherwise injurious to third parties or objectionable and does not consist of or contain software viruses, political campaigning, commercial solicitation, chain letters, mass mailings, or any form of &quot;spam&quot;. You may not use a false e-mail address, impersonate any person or entity, or otherwise mislead as to the origin of a card or other content. FutSeller keeps the right (but not the obligation) to remove or edit such content, but does not regularly review posted content. Once you submit content or material, and by default, you grant FutSeller and its affiliates a royalty-free, nonexclusive, eternal, irrevocable, and fully sub licensable right to use, reproduce, modify, publish, translate, create works from, and distribute such content in any place. You grant FutSeller and its affiliates for all claims resulting from content you supply. FutSeller has the right but not the obligation to monitor and edit or remove any activity or content. FutSeller has no responsibility for any content posted by you or any third party.</p><p><strong class=\"hptitfont\">COPYRIGHT COMPLAINTS</strong></p><p>FutSeller and its affiliates respect the intellectual property of others. If you think that your work has been copied in a way that constitutes copyright infringement, please contact our legal department about making claims of copyright infringement.</p><p><strong class=\"hptitfont\">PRODUCT DESCRIPTIONS</strong></p><p>FutSeller and its affiliates try to be as exact as possible in describing a product or service. However, FutSeller does not warrant that product descriptions or other content of this site is exact, complete, reliable, current, or error-free. When a product offered by FutSeller itself is not as described, your sole remedy is to return it within 24 hours of purchase.</p><p><strong class=\"hptitfont\">OTHER BUSINESSES</strong></p><p>Different from FutSeller and its subsidiaries operate stores, the parties provide services, or sell products lines on this site. Otherwise, we provide hyperlink for the site of affiliated companies and certain other businesses. We are not responsible for examining or evaluating, and we do not assurance the offerings of, any of these businesses or individuals or the content of their Web sites. FutSeller does not assume any responsibility or liability for the actions, product, and content of all these and any other third parties. You should carefully review their privacy statements and other conditions of use.</p><p><strong class=\"hptitfont\">DISPUTES</strong></p><p>Any dispute relative to browse FutSeller&#39;s website or the products and /or services you purchase though FutSeller shall be submitted to confidential arbitration in New York or Hong Kong. Besides, to the length you have in any manner violated or threatened to violate FutSeller&#39;s intellectual property rights, FutSeller may search injunctive or other appropriate relief in any court in the World, and you consent to exclusive jurisdiction and venue in such courts. Arbitration under this agreement shall be conducted under the rules then prevailing in Hong Kong. The arbitrator&#39;s award shall be binding and may be entered as a judgment in any court of competent jurisdiction. To the fullest extent permitted by applicable law, no arbitration under this Agreement shall be joined to an arbitration involving any other party subject to this Agreement, whether through class arbitration proceedings or otherwise.</p><p><strong class=\"hptitfont\">SITE POLICIES, MODIFICATION, AND SEVERABILITY</strong></p><p>Please read other policies, for example our PRIVACY POLICY, posted on this site. These policies are also control your visit to FutSeller&#39;s Web sites. We reserve the right to make changes to our site, policies, and these TERMS &amp; CONDITIONS at any time. If any of these conditions shall be deemed invalid, void, or for any reason unenforceable, that condition shall be deemed severable and shall not affect the validity and enforceability of any remaining condition.</p><p><strong class=\"hptitfont\">PRICE MATCHING</strong></p><p>This site does not currently support Price Matching. If you find a better price at another online store we will do our best to beat it.</p><p><strong class=\"hptitfont\">SATISFACTION GUARANTEE</strong></p><p>FutSeller offers a 100% satisfaction guarantee that permits you to return any goods undamaged for a full refund within 24 hours of purchasing.</p><p><strong class=\"hptitfont\">PRICE PROTECTION POLICY</strong></p><p>FutSeller currently offers a price protection when making purchases. If you purchase a product or service from FutSeller and the price is lowered within 24 hours of that purchase, you may contact FutSeller through the Live Help with your order number to receive additional products to make up for the difference.</p><p><strong class=\"hptitfont\">BILLING</strong></p><p>Pleases keep in mind that we do NOT charge your credit card until your order enters the delivery process. We verify prices and stock as part of our shipping procedures. If an item&#39;s correct price is lower than our stated price, we charge the lower amount and ship you the item. If an item&#39;s correct price is higher than our stated price, we will, at our discretion, either contact you for instructions before shipping or cancel your order and notify you of such cancellation. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<br/><br/><br/>These Terms and Conditions constitute the entire agreement between you and FutSeller regarding the subject matter hereof.</p>', '', '');
