(1, 'FIFA 账号发货邮件', '邮件模板替换参数:<br>\r\n用户名:{user_full_name}<br>\r\n网站名:{site_name}<br>\r\n网站域名:{site_domain}<br>\r\n商品名:{product_name}<br>\r\n订单号:{order_no}<br>\r\n回复收件人邮箱:{mail_reply}<br>\r\n游戏账号信息: {account_info}<br>', 'fifa', 'fifa-account', '2', 'Your account details from {site_name}  (Order #{order_no})', '<p>Dear {user_full_name},</p><p>Thanks for your order!</p><p>Order No.: {order_no}, Item: {product_name}.</p><p>The account details as bellow,</p><p>{account_info}</p><p><br/></p><p>Please change your password and transfer coins to your main account after you received our account information for safety as soon as possible.</p><p>Best regards.<br/></p><p><br/></p><p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);\">Notice: Please do not reply to this message, this is the system automatically mail.</span></p><p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);\">If you have any question or concern, feel free to go to our site <a href=\"http://{site_domain}\" target=\"_blank\">{site_domain}</a> and contact our support agent anytime, you can also email us at <a href=\"mailto:{mail_reply}\">{mail_reply}</a>.</span></p><p><br/></p>', 1, 1440237604);
